['El pasado lunes 22 de agosto se llevó a cabo en el Auditorio Uriel Estrada de la Sede Nacional ubicada en Cali, la firma de la alianza entre @SENA_RValle y la #FundaciónCoomeva que permitirá diseñar e implementar estrategias que fortalezcan el emprendimiento a través de programas de formación empresarial, con el objetivo de implementar buenas prácticas para la gestión de la innovación con el desarrollo conjunto de actividades de ambas entidades, fomentando una cultura en acciones enfocadas al desarrollo empresarial.

Espera pronto más información sobre este convenio. Visita fundacion.coomeva.com.co

@senacomunica #tbt']

